import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';

export default function TwitsList() {
  return (
    <List sx={{ width: '100%', bgcolor: 'background.paper' }}>
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar
            alt="Remy Sharp"
            src="https://i.pinimg.com/736x/a4/24/40/a42440fcb66eb1b0a2d944284dac1431.jpg"
          />
        </ListItemAvatar>
        <ListItemText
          primary="Из огня да в полымя..."
          secondary={
            <React.Fragment>
              <Typography
                sx={{ display: 'inline' }}
                component="span"
                variant="body2"
                color="text.primary">
                Ali Connors
              </Typography>
              Европа, стремящаяся снизить долю России в поставках энергоресурсов, теперь, похоже,
              попадает из огня да в полымя.
            </React.Fragment>
          }
        />
      </ListItem>
      <Divider
        variant="inset"
        component="li"
      />
    </List>
  );
}
